// src/components/ContactBox.js
import React from 'react';
import styled from 'styled-components';
import img5650 from '../assets/31.jpeg';

const ContactBoxContainer = styled.div`
  background: #fff;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  padding: 20px;
  text-align: center;
  margin-top: 20px;
`;

const BoxTitle = styled.h3`
  font-size: 24px;
  margin-bottom: 10px;
`;

const BoxDescription = styled.p`
  font-size: 16px;
  color: #555;
`;

const ContactBox = () => (
  <ContactBoxContainer>
    <BoxTitle>Contact us</BoxTitle>
    <div style={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
      {[...Array(4)].map((_, index) => (
        <div key={index} style={{ textAlign: 'center', margin: '10px' }}>
          <img
            src={img5650}
            alt="Contact Person"
            style={{ width: '200px', height: '200px', borderRadius: '10px', marginBottom: '10px' }}
          />
          <BoxDescription>
            Phone: +91 9429428442<br />
            Email: mehta.aditya@iitgn.ac.in<br />
            Address: IIT Gandhinagar
          </BoxDescription>
        </div>
      ))}
    </div>
  </ContactBoxContainer>
);

export default ContactBox;
